def cloudcommunications_redirect(client,
                                 call_id,
                                 targets=None,
                                 target_disposition=None,
                                 timeout=None,
                                 mask_callee=None,
                                 mask_caller=None,
                                 callback_uri=None):
    if mask_callee is None:
        mask_callee = False
    if mask_caller is None:
        mask_caller = False
    return client.redirect(call_id=call_id,
                           targets=targets,
                           target_disposition=target_disposition,
                           timeout=timeout,
                           mask_callee=mask_callee,
                           mask_caller=mask_caller,
                           callback_uri=callback_uri)


